import React from 'react';
import Tree from './Tree'; // załóżmy, że Tree jest eksportowany z pliku 'Tree.js'

const SomeComponent = () => {
  const treeData = [
    {
      id: 1,
      name: 'Root 1',
      children: [
        {
          id: 2,
          name: 'Child 1',
        },
        {
          id: 3,
          name: 'Child 2',
          children: [
            {
              id: 4,
              name: 'Grandchild',
            },
          ],
        },
      ],
    },
    {
      id: 5,
      name: 'Root 2',
    },
  ];

  return (
    <div>
      <h1>Here is a tree:</h1>
      <Tree data={treeData} />
    </div>
  );
};

export default SomeComponent;
